import { useState } from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { Table, TableContainer, TableHead, TableCell, TableBody, TableRow, Modal, Button, TextField } from '@material-ui/core';

import styles from '../css/modal.module.css'

const AnalisisCredito = (props) => {

    const [modalState, setModalState] = useState(true);

    const closeModal = () => {
        setModalState(false);
    }

    const useStyles = makeStyles((theme) => ({
        modal: {
            position: 'absolute',
            width: 400,
            backgroundColor: theme.palette.background.paper,
            border: '2px solid #000',
            boxShadow: theme.shadows[5],
            padding: theme.spacing(2, 4, 3),
            top: '50%',
            left: '50%',
            transform: 'translate(-50%, -50%)'
        },
        iconos: {
            cursor: 'pointer'
        },
        inputMaterial: {
            width: '100%'
        }
    }));

    const stylesss = useStyles();

    return (

        <Modal open={modalState}>
            <div className={styles.modal}>
                <h3>Editar Consola</h3>
                <TextField name="nombre" className={styles.inputMaterial} />
                <br />
                <TextField name="empresa" className={styles.inputMaterial} />
                <br />
                <TextField name="lanzamiento" className={styles.inputMaterial} label="Lanzamiento"/>
                <br />
                <TextField name="unidades_vendidas" className={styles.inputMaterial} label="Unidades Vendidas"/>
                <br /><br />
                <div align="right">
                    <Button color="primary" >Editar</Button>
                    <Button >Cancelar</Button>
                </div>
            </div>
        </Modal>


    )
};

export default AnalisisCredito;
